import React from 'react'
import projects from '../res/projects.'
const Nav = () => {
  return (
    <header>
      <img className='logo' src="../res/main-logo.png" alt="Stanley Lin"/>
      <nav>
        <ul>
          <li><img className='nav-button' src='../res/projects-button.png'/></li>
          <li><img className='nav-button' src='../res/experience-button.png'/></li>
          <li><img className='nav-button' src='../res/connect-button.png'/></li>
        </ul>
      </nav>
    </header>
  );
};

export default Nav
